import React from "react";
import Header from "next/head";

function HomePage() {
  return (
    <div>
      <Header>
        <title>Project 4</title>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      </Header>
    </div>
  );
}

export default HomePage;
